import React, { useState } from 'react';
import axios from 'axios';

const Add = () => {
  const [name, setName] = useState('');
  const [address, setAddress] = useState('');
  const [phone, setPhone] = useState('');
  const [email, setEmail] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const res = await axios.post('http://localhost:5005/api/labs', {
        name: name,
        address: address,
        email: email,
        phone: phone,
        headers: {
          'Content-Type': 'application/json',
        },
      });
      console.log(res.data);
      console.log('NEW Lab ADDED');
    } catch (error) {
      console.log(error);
    }
  };

  return (

    <>
      <div class='bg-background'>
        <div class='container mx-auto p-large'>
          <form className='create p-large gradient rounded-3xl ' onSubmit={handleSubmit}>
            <h3 class='mb-10 font-bold text-3xl'>  Add a New Lab</h3>
            <label class='mb-2 text-sm font-medium mr-5' htmlFor=''>Name: </label>
            <input
              class='p-2.5 text-textLight shadow rounded'
              type='text'
              onChange={(e) => setName(e.target.value)}
              value={name}
            />
            <br />
            <label class='mb-2 text-sm font-medium mr-5' htmlFor=''>Address: </label>
            <input
              class='p-2.5 text-textLight shadow rounded'
              type='text'
              onChange={(e) => setAddress(e.target.value)}
              value={address}
            />{' '}
            <br />
            <label class='mb-2 text-sm font-medium mr-5' htmlFor=''>Phone </label>
            <input
              class='p-2.5 text-textLight shadow rounded'
              type='text'
              onChange={(e) => setPhone(e.target.value)}
              value={phone}
            />
            <br />
            <label class='mb-2 text-sm font-medium mr-5' htmlFor=''>Email: </label>
            <input
              class='p-2.5 text-textLight shadow rounded'
              type='email'
              onChange={(e) => setEmail(e.target.value)}
              value={email}
            />
            <br />
            <button> Add Lab</button>
          </form>
        </div>
      </div>
    </>
  );
};

export default Add;
